import Image from './Image/index'

const Member = () => {
    return (
        <div className="row">
            <div className="col-lg-4 col-md-6 d-inline align-items-stretch" data-aos="fade-up" data-aos-delay="200">
                <div className="member">
                    <Image />
                </div>
            </div>
        </div>
    )
}

export default Member;
